import Navbar from '../components/Navbar'
import './SignIn.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowRight } from '@fortawesome/free-solid-svg-icons'

function SignIn() {
  return (
    <div className="signin-container">
      <Navbar />
      <div className="inputs-container">
          <form className="inputs">
            <h1 id="signin-title">Welcome Back !</h1>
            <input placeholder="Email" type="email"  name="email" className="inputs-sign-in"/>
            <input placeholder='Password' type="password"  name="password" className="inputs-sign-in"/>
            <button className='signin-btn'><FontAwesomeIcon icon={faArrowRight} /></button>
          </form>
          <a href="/signup" className="sign-in-aref">don't have an account?</a>
      </div>
    </div>

  );
}

export default SignIn;
